import React, { Component } from 'react';
import logo from './logo.svg';
import paypalLogo from './paypal-logo-color.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={paypalLogo} className="PayPal-logo" alt="logo" />
          <p>
            You have successfully started the PayPal Digitizing Paper Forms 1.0 App!!
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default App;
